/*Table structure for table `tb_customer` */

DROP TABLE IF EXISTS `tb_customer`;

CREATE TABLE `tb_customer` (
  `ID` int(10) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `CUSTOMERID` varchar(14) NOT NULL COMMENT '客户序号',
  `CUSTOMERNAME` varchar(20) NOT NULL COMMENT '客户姓名',
  `SEX` varchar(1) NOT NULL COMMENT '性别',
  `TELEPHONE` varchar(20) DEFAULT NULL COMMENT '电话',
  `EMAIL` varchar(50) DEFAULT NULL COMMENT '电子邮件',
  `SCHOOL` varchar(50) DEFAULT NULL COMMENT '学校',
  `MAJOR` varchar(20) DEFAULT NULL COMMENT '专业',
  `EDUCATION` varchar(1) DEFAULT NULL COMMENT '学历',
  `OPERATOR` varchar(20) NOT NULL COMMENT '操作者',
  `COLLECTOR` varchar(20) NOT NULL COMMENT '采集人',
  `CREATETIME` datetime NOT NULL COMMENT '创建时间',
  `SOURCE` varchar(2) NOT NULL COMMENT '来源渠道',
  `CUSTOMERTYPE` varchar(1) NOT NULL COMMENT '客户类型,1个人客户2企业客户',
  `COURSE` varchar(1) NOT NULL COMMENT '意向课程',
  `JOBOBJECTIVE` varchar(1) NOT NULL COMMENT '求职意向',
  `BIRTHDAY` date DEFAULT NULL COMMENT '生日',
  `PLACEOFBIRTH` varchar(100) DEFAULT NULL COMMENT '户口所在地',
  `ADDRESS` varchar(100) DEFAULT NULL COMMENT '现居住地',
  `POLITICALSTATUS` varchar(1) DEFAULT NULL COMMENT '政治面貌',
  `NATIONALITY` varchar(2) DEFAULT NULL COMMENT '民族',
  `MARITALSTATUS` varchar(1) DEFAULT NULL COMMENT '婚育状况',
  `WORKSERVICE` varchar(2) DEFAULT NULL COMMENT '工作年限',
  `WORKEXP` varchar(400) DEFAULT NULL COMMENT '工作经历',
  `WORKPLACE` varchar(1) DEFAULT NULL COMMENT '期望工作地点',
  `SALARY` varchar(5) DEFAULT NULL COMMENT '期望薪资',
  `ECP` varchar(30) DEFAULT NULL COMMENT '紧急联系人方式',
  `BANK` varchar(50) DEFAULT NULL COMMENT '开户行',
  `BANKNO` varchar(18) DEFAULT NULL COMMENT '银行卡号',
  `MEMO` varchar(500) DEFAULT NULL COMMENT '备注',
  `STATUS` varchar(1) NOT NULL COMMENT '状态',
  `ASSIGNTYPE` varchar(1) NOT NULL COMMENT '分配状态，0待分配，1已分配，2待重新分配',
  `CLASSIFICATIONSTANDARD` varchar(255) DEFAULT NULL COMMENT '分类等级标准，备用',
  `OLDCID` varchar(14) DEFAULT NULL,
  `BIGMAJOR` varchar(2) DEFAULT NULL,
  `RESUMEURL` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`ID`,`CUSTOMERID`),
  KEY `CUSTOMERID` (`CUSTOMERID`)
) ENGINE=InnoDB AUTO_INCREMENT=1331 DEFAULT CHARSET=utf8;

