/*Table structure for table `tb_customer_assign` */

DROP TABLE IF EXISTS `tb_customer_assign`;

CREATE TABLE `tb_customer_assign` (
  `ASSIGNID` varchar(14) NOT NULL COMMENT '分配序号',
  `CUSTOMERID` varchar(14) NOT NULL COMMENT '客户序号',
  `ASSIGNTIME` datetime NOT NULL COMMENT '分配时间',
  `PROCESSTIME` datetime DEFAULT NULL COMMENT '处理时间',
  `ASSIGNUSERID` varchar(20) NOT NULL COMMENT '分配人',
  `USERID` varchar(20) NOT NULL COMMENT '当前拥有者',
  `STATUS` varchar(1) NOT NULL COMMENT '分配状态,0分配跟进中1处理完毕2主动放弃4被动放弃',
  PRIMARY KEY (`ASSIGNID`),
  KEY `CUSTOMERID` (`CUSTOMERID`),
  KEY `ASSIGNUSERID` (`ASSIGNUSERID`),
  KEY `USERID` (`USERID`),
  CONSTRAINT `tb_customer_assign_ibfk_1` FOREIGN KEY (`CUSTOMERID`) REFERENCES `tb_customer` (`CUSTOMERID`),
  CONSTRAINT `tb_customer_assign_ibfk_2` FOREIGN KEY (`ASSIGNUSERID`) REFERENCES `tb_sys_user` (`USERID`),
  CONSTRAINT `tb_customer_assign_ibfk_3` FOREIGN KEY (`USERID`) REFERENCES `tb_sys_user` (`USERID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

