/*Table structure for table `tb_customer_callback` */

DROP TABLE IF EXISTS `tb_customer_callback`;

CREATE TABLE `tb_customer_callback` (
  `CALLBACKID` int(10) NOT NULL AUTO_INCREMENT COMMENT '回访序号',
  `CUSTOMERID` varchar(14) NOT NULL COMMENT '客户编号',
  `RESEAON` varchar(2) NOT NULL COMMENT '回访原因',
  `CALLTIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '回访时间，默认现在',
  `REPORTUSERID` varchar(20) NOT NULL COMMENT '报告人，默认登录用户',
  `INTENTION` varchar(1) DEFAULT NULL COMMENT '意向度，0否1是',
