  `TIPS` varchar(500) DEFAULT NULL COMMENT '提醒内容',
  `TIPDATE` date NOT NULL COMMENT '提醒时间',
  `MEMO` varchar(500) DEFAULT NULL COMMENT '沟通内容',
  `RESOURCEID` varchar(14) DEFAULT NULL COMMENT '来源ID',
  `CALLBACKTYPE` varchar(1) DEFAULT NULL COMMENT '回访来源',
  `STATUS` varchar(1) NOT NULL COMMENT '状态',
  PRIMARY KEY (`CALLBACKID`),
  KEY `CUSTOMERID` (`CUSTOMERID`),
  KEY `REPORTUSERID` (`REPORTUSERID`),
  CONSTRAINT `tb_customer_callback_ibfk_1` FOREIGN KEY (`CUSTOMERID`) REFERENCES `tb_customer` (`CUSTOMERID`),
  CONSTRAINT `tb_customer_callback_ibfk_2` FOREIGN KEY (`REPORTUSERID`) REFERENCES `tb_sys_user` (`USERID`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8;

