/*Table structure for table `tb_order_orders` */

DROP TABLE IF EXISTS `tb_order_orders`;

CREATE TABLE `tb_order_orders` (
  `ID` varchar(14) NOT NULL COMMENT '序号',
  `CUSTOMERID` varchar(14) NOT NULL,
  `ORDERID` varchar(14) NOT NULL COMMENT '订单号',
  `CREATETIME` datetime NOT NULL COMMENT '创建时间,默认为现在',
  `USERID` varchar(20) NOT NULL COMMENT '当前销售',
  `DEPTID` varchar(14) NOT NULL COMMENT '销售部门',
  `PRODID` varchar(14) NOT NULL COMMENT '产品编号',
  `PRODNAME` varchar(40) NOT NULL COMMENT '产品名称',
  `PRICE` float NOT NULL COMMENT '产品价格',
  `DEPOSIT` float DEFAULT NULL COMMENT '定金',
  `DISCOUNT` float DEFAULT NULL COMMENT '折扣金额',
  `AMOUNT` float NOT NULL COMMENT '应收金额',
  `AMOUNTCOUNT` float NOT NULL COMMENT '已收金额',
  `ORDERTYPE` varchar(1) NOT NULL DEFAULT '1' COMMENT '订单类型,备用',
  `STATUS` varchar(4) NOT NULL COMMENT '状态',
  `PROMOCODE` varchar(18) DEFAULT NULL COMMENT '促销码',
  `PROMOMONEY` float DEFAULT NULL COMMENT '促销金额',
  `PAYMETHOD` varchar(1) NOT NULL COMMENT '付款方式',
  `BANKINGBOOK` varchar(1) DEFAULT NULL COMMENT '银行账簿',
  `ATTACHMENT` varchar(300) DEFAULT NULL COMMENT '附件',
  `MEMO` varchar(500) DEFAULT NULL COMMENT '备注',
  `APPROVEID` varchar(14) DEFAULT NULL COMMENT '审批流序号',
  PRIMARY KEY (`ID`),
  KEY `CUSTOMERID` (`CUSTOMERID`),
  KEY `USERID` (`USERID`),
  KEY `PRODID` (`PRODID`),
  KEY `PROMOCODE` (`PROMOCODE`),
  KEY `ORDERID` (`ORDERID`),
  KEY `DEPTID` (`DEPTID`),
  CONSTRAINT `tb_order_orders_ibfk_1` FOREIGN KEY (`CUSTOMERID`) REFERENCES `tb_customer` (`CUSTOMERID`),
  CONSTRAINT `tb_order_orders_ibfk_2` FOREIGN KEY (`USERID`) REFERENCES `tb_sys_user` (`USERID`),
  CONSTRAINT `tb_order_orders_ibfk_4` FOREIGN KEY (`PRODID`) REFERENCES `tb_prod_base` (`PRODID`),
  CONSTRAINT `tb_order_orders_ibfk_5` FOREIGN KEY (`DEPTID`) REFERENCES `tb_sys_dept` (`DEPTID`)
