/*Table structure for table `tb_order_payment` */

DROP TABLE IF EXISTS `tb_order_payment`;

CREATE TABLE `tb_order_payment` (
  `ID` varchar(14) NOT NULL COMMENT '序号',
  `ORDERID` varchar(14) NOT NULL COMMENT '订单号',
  `PRODID` varchar(14) NOT NULL COMMENT '子产品编号',
  `PRODNAME` varchar(100) NOT NULL COMMENT '子产品名称',
