  CONSTRAINT `tb_order_payment_ibfk_2` FOREIGN KEY (`USERID`) REFERENCES `tb_sys_user` (`USERID`),
  CONSTRAINT `tb_order_payment_ibfk_3` FOREIGN KEY (`USERDEPT`) REFERENCES `tb_sys_dept` (`DEPTID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

