/*Table structure for table `tb_sys_dept` */

DROP TABLE IF EXISTS `tb_sys_dept`;

CREATE TABLE `tb_sys_dept` (
  `ID` varchar(14) NOT NULL COMMENT '编号',
  `DEPTID` varchar(14) NOT NULL COMMENT '部门编号,有固定的编码格式，2位一级，如100101就是三级的部门',
  `DEPTNAME` varchar(50) NOT NULL COMMENT '部门名称',
  `DEPTLEVEL` varchar(1) NOT NULL COMMENT '部门级别,0根节点，1子节点',
  `TOPDEPTID` varchar(14) DEFAULT NULL COMMENT '上级部门ID',
  `PERFORMANCE` varchar(1) NOT NULL COMMENT '业绩核算类型,1社招,2求职,3搜索,4口碑',
  `USERID` varchar(20) NOT NULL COMMENT '部门负责人',
  `DEPTTYPE` varchar(1) DEFAULT NULL COMMENT '部门类型,1业务部门，2支持部门',
  `STATUS` varchar(1) NOT NULL COMMENT '状态，0禁用1启用',
  PRIMARY KEY (`ID`),
  KEY `DEPTID` (`DEPTID`),
  KEY `USERID` (`USERID`)
