/*Table structure for table `tb_sys_deptpermission` */

DROP TABLE IF EXISTS `tb_sys_deptpermission`;

CREATE TABLE `tb_sys_deptpermission` (
  `ID` varchar(14) NOT NULL COMMENT '序号',
  `DEPTID` varchar(14) NOT NULL COMMENT '部门编号',
  `PRODENABLE` varchar(400) NOT NULL COMMENT '授权产品,默认所有产品',
  `CREATETIME` datetime NOT NULL COMMENT '创建时间',
  `UPDATETIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最近更新时间',
  PRIMARY KEY (`ID`),
  KEY `DEPTID` (`DEPTID`),
  CONSTRAINT `tb_sys_deptpermission_ibfk_1` FOREIGN KEY (`DEPTID`) REFERENCES `tb_sys_dept` (`DEPTID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

