/*Table structure for table `tb_sys_log` */

DROP TABLE IF EXISTS `tb_sys_log`;

CREATE TABLE `tb_sys_log` (
  `ID` varchar(14) NOT NULL COMMENT '序号,格式为YYYYMMDD000001',
  `USERID` varchar(20) NOT NULL COMMENT '操作人id,使用公司员工编号',
  `CREATETIME` datetime NOT NULL COMMENT '发生时间，默认为当前日期',
  `REMOTEIP` varchar(50) DEFAULT NULL COMMENT '远程ip',
  `PERMID` varchar(50) NOT NULL COMMENT '功能名称编号',
  `REQUESTURL` varchar(255) NOT NULL COMMENT '请求的url',
  `REQUESTOPER` varchar(20) DEFAULT NULL COMMENT '请求的操作，如ADD/UPD/DEL/QRY',
  PRIMARY KEY (`ID`),
  KEY `USERID` (`USERID`),
  CONSTRAINT `tb_sys_log_ibfk_1` FOREIGN KEY (`USERID`) REFERENCES `tb_sys_user` (`USERID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

