/*Table structure for table `tb_sys_user` */

DROP TABLE IF EXISTS `tb_sys_user`;

CREATE TABLE `tb_sys_user` (
  `ID` varchar(14) NOT NULL COMMENT '序号，格式为YYYYMMDD0001',
  `USERID` varchar(20) NOT NULL COMMENT '用户ID',
  `LOGINNAME` varchar(50) DEFAULT NULL COMMENT '账号名',
  `USERPASSWORD` varchar(50) NOT NULL COMMENT '密码',
  `PASSTYPE` varchar(1) NOT NULL DEFAULT '1' COMMENT '临时密码，0代表不是，1代表是,只有在重置密码后才能将此字段设为1，且密码动态变为系统随机生成的',
  `PASSEXPIRE` datetime DEFAULT NULL COMMENT '密码过期时间,超过密码过期时间的是无法新建用户、密码初始化、密码修改的，新设密码后在90天后过期',
  `USERNAME` varchar(50) NOT NULL COMMENT '用户姓名',
  `CARDID` varchar(18) DEFAULT NULL COMMENT '身份证号',
  `MOBILE` varchar(20) NOT NULL COMMENT '手机号码',
  `TELEPHONE` varchar(20) DEFAULT NULL COMMENT '固定电话',
  `ADDRESS` varchar(50) DEFAULT NULL COMMENT '联系地址',
  `EMAIL` varchar(50) DEFAULT NULL COMMENT '电子邮箱',
  `DESCRIPTION` varchar(100) DEFAULT NULL COMMENT '描述信息',
  `CREATETIME` datetime NOT NULL COMMENT '创建时间,默认为now()',
  `JOINUSTIME` datetime DEFAULT NULL COMMENT '入职时间',
  `LEAVETIME` datetime DEFAULT NULL COMMENT '离职时间',
  `LASTLOGINTIME` datetime NOT NULL COMMENT '最近登录时间',
  `LOGINCOUNT` int(10) NOT NULL DEFAULT '0' COMMENT '登录次数，初始化为0',
  `LOGINFAILEDCOUNT` int(10) NOT NULL DEFAULT '0' COMMENT '登录失败次数,初始化为0',
  `DEPTID` varchar(14) DEFAULT NULL COMMENT '所属部门',
  `USERTYPE` varchar(1) DEFAULT NULL COMMENT '用户类型，备用字段',
  `STATUS` int(10) NOT NULL DEFAULT '1' COMMENT '用户状态，0锁定，1启用，2禁用',
  PRIMARY KEY (`ID`),
  KEY `USERID` (`USERID`),
  KEY `DEPTID` (`DEPTID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

