/*Table structure for table `tb_sys_userpermission` */

DROP TABLE IF EXISTS `tb_sys_userpermission`;

CREATE TABLE `tb_sys_userpermission` (
  `ID` varchar(14) NOT NULL COMMENT '序号',
  `USERID` varchar(20) NOT NULL COMMENT '员工ID',
  `DEPTENABLE` varchar(500) NOT NULL COMMENT '授权数据，默认为本部门，用“|”间隔',
  `CREATETIME` datetime NOT NULL COMMENT '创建时间',
  `UPDATETIME` datetime DEFAULT NULL COMMENT '最近更新时间',
  PRIMARY KEY (`ID`),
  KEY `USERID` (`USERID`),
  CONSTRAINT `tb_sys_userpermission_ibfk_1` FOREIGN KEY (`USERID`) REFERENCES `tb_sys_user` (`USERID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tb_sys_userpermission` */

/*Table structure for table `tb_sys_userrole` */

DROP TABLE IF EXISTS `tb_sys_userrole`;

CREATE TABLE `tb_sys_userrole` (
  `USEROLEID` varchar(14) NOT NULL COMMENT '序号',
  `USERID` varchar(20) NOT NULL COMMENT '用户序号',
  `ROLEID` varchar(14) NOT NULL COMMENT '角色序号',
  PRIMARY KEY (`USEROLEID`),
  KEY `USERID` (`USERID`),
  KEY `ROLEID` (`ROLEID`),
  CONSTRAINT `tb_sys_userrole_ibfk_1` FOREIGN KEY (`USERID`) REFERENCES `tb_sys_user` (`USERID`),
  CONSTRAINT `tb_sys_userrole_ibfk_2` FOREIGN KEY (`ROLEID`) REFERENCES `tb_sys_role` (`ROLEID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

