/* Function  structure for function  `F_assignCustomer` */

/*!50003 DROP FUNCTION IF EXISTS `F_assignCustomer` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `F_assignCustomer`(v_seq_name VARCHAR(50)) RETURNS varchar(50) CHARSET utf8
begin	
		DECLARE cid VARCHAR(50);		
		select customerid into cid from tb_customer_assign WHERE ASSIGNID = (SELECT current_val from tb_sys_sequence where seq_name = v_seq_name );
		update tb_customer set ASSIGNTYPE = 1  where CUSTOMERID = cid; -- 更改客户分配状态
		return '0';
end */$$
DELIMITER ;

/* Function  structure for function  `F_currval` */

/*!50003 DROP FUNCTION IF EXISTS `F_currval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `F_currval`(v_seq_name VARCHAR(50)) RETURNS varchar(50) CHARSET utf8
begin     
    declare value VARCHAR(50);       
    set value = '0';       
    select current_val into value  from tb_sys_sequence where seq_name = v_seq_name; 
   return value; 
end */$$
DELIMITER ;

/* Function  structure for function  `F_nextval` */

/*!50003 DROP FUNCTION IF EXISTS `F_nextval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `F_nextval`(v_seq_name VARCHAR(50)) RETURNS varchar(50) CHARSET utf8
begin
		DECLARE prefix,sid,snum VARCHAR(50);
		set prefix = DATE_FORMAT(CURDATE(),'%Y%m%d'); -- 日期前缀
		set sid = '0';
		select current_val into sid from tb_sys_sequence where seq_name = v_seq_name; 
	  set snum := substring(sid,9); -- 截取日期后的数据 -- mysql赋值语句 用":="
		update tb_sys_sequence set current_val = CONCAT( prefix, LPAD(snum + increment_val ,6,0)) where seq_name = v_seq_name; -- 将截取后的数据加上步长不足6位补上并拼上日期
		return F_currval(v_seq_name);
end */$$
DELIMITER ;

/* Function  structure for function  `F_number` */

/*!50003 DROP FUNCTION IF EXISTS `F_number` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `F_number`(v_seq_name VARCHAR(50), prefix VARCHAR(5)) RETURNS varchar(50) CHARSET utf8
BEGIN
		DECLARE sid VARCHAR(50);
		DECLARE flag,snum INT;
		select current_val into sid from tb_sys_sequence where seq_name = v_seq_name; -- 获得当前编号
		SELECT SUBSTR(sid,CHAR_LENGTH(prefix)+1,8) = date_format(now(),'%Y%m%d') INTO flag; -- 判断当前编号是否为今日插入
		IF flag = 1 THEN			
			set snum := SUBSTR(sid,CHAR_LENGTH(prefix)+9);-- 截取日期后面的自增数据
		ELSE 			
			SET snum := 0; -- 新增今日的第一个编号			
		END IF;
		update tb_sys_sequence set current_val = CONCAT( prefix,date_format(now(),'%Y%m%d'), LPAD(snum + increment_val ,14 - (CHAR_LENGTH(prefix)+8),0)) where seq_name = v_seq_name; -- 将截取后的数据加上步长不足6位补上并拼上日期
		return F_currval(v_seq_name);	
	END */$$
DELIMITER ;

/* Procedure structure for procedure `P_insert_paymentChangeOrdersStatus` */

/*!50003 DROP PROCEDURE IF EXISTS  `P_insert_paymentChangeOrdersStatus` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `P_insert_paymentChangeOrdersStatus`()
BEGIN	
	DECLARE a, ac, flag FLOAT DEFAULT 0;
	DECLARE oid, pid VARCHAR(20);
	SELECT ORDERID, PRODID, AMOUNT INTO oid ,pid, ac 
		FROM tb_order_payment WHERE id = (SELECT F_currval('tb_order_payment'));
	SELECT amount INTO a FROM tb_order_orderdetail WHERE orderid = oid AND prodid = pid;
	IF ac < 0 THEN 
		-- 如果当前的收款小于0（结合订单表知道收款类型是退款还是返款）
		set flag := 1;
		UPDATE tb_order_orders SET STATUS = STATUS + 1 WHERE orderid = oid;		
	ELSEIF a = ac THEN
		-- 如果当前的收款等于应缴金额		
		UPDATE tb_order_orderdetail SET STATUS = '2' WHERE orderid = oid AND prodid = pid;
	ELSE 			
		SELECT amount INTO a FROM tb_order_orderdetail WHERE orderid = oid AND prodid = pid;
		SELECT SUM(amount) INTO ac FROM tb_order_payment WHERE orderid = oid AND prodid = pid;
		IF a > ac THEN			
			UPDATE tb_order_orderdetail SET STATUS = '1' WHERE orderid = oid AND prodid = pid;
		ELSE			
			UPDATE tb_order_orderdetail SET STATUS = '2' WHERE orderid = oid AND prodid = pid;
		END IF;
	END IF;
	select flag;
	IF flag <> 1 THEN
		SELECT SUM(amount) INTO ac FROM tb_order_payment WHERE orderid = oid;
		SELECT AMOUNT INTO a FROM tb_order_orders WHERE orderid = oid;
		IF a = ac THEN 		
			UPDATE tb_order_orders SET STATUS = '1013' WHERE ORDERID = oid;
		ELSE 			
			UPDATE tb_order_orders SET STATUS = '1012' WHERE ORDERID = oid;
		END IF;
	END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `P_insert_paymentChangeOrdersStatus1` */

/*!50003 DROP PROCEDURE IF EXISTS  `P_insert_paymentChangeOrdersStatus1` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `P_insert_paymentChangeOrdersStatus1`(IN _amount FLOAT, in _orderid VARCHAR(20))
BEGIN	
	DECLARE a, ac FLOAT DEFAULT 0; -- a 代表应收款 ，ac 代表已收款总计
	SELECT amount into a from tb_order_orders WHERE ORDERID = _orderid;
	SELECT SUM(amount) INTO ac FROM tb_order_payment WHERE ORDERID = _orderid;

	IF _amount < 0 THEN 
		-- 如果当前的收款小于0（结合订单表知道收款类型是退款还是返款）
		UPDATE tb_order_orders SET STATUS = STATUS + 1 WHERE orderid = _orderid;		
	ELSEIF a = ac THEN
		-- 如果当前的收款总额等于应缴金额		
		UPDATE tb_order_orders SET STATUS = '1013' WHERE ORDERID = _orderid;
		UPDATE tb_order_orderdetail SET STATUS = '2' WHERE orderid = _orderid;
	ELSE
		-- 如果当前的收款总额小于应缴金额	
		UPDATE tb_order_orders SET STATUS = '1012' WHERE ORDERID = _orderid;
		-- 创建一个临时表
		CREATE TABLE temp_table(ID varchar(50) not null);
		INSERT INTO temp_table(ID) SELECT d.ID FROM tb_order_orderdetail d INNER JOIN tb_order_payment p 
																ON p.ORDERID = d.ORDERID AND p.PRODID = d.PRODID 
																WHERE p.ORDERID = _orderid 
																GROUP BY p.PRODID HAVING SUM(p.AMOUNT) < SUM(d.AMOUNT); -- 新增表数据
		UPDATE tb_order_orderdetail SET STATUS = '1' WHERE ID IN (SELECT id FROM temp_table); -- 更改订单详情状态(收部分款)
		-- 删除表数据
		DELETE FROM temp_table;
		INSERT INTO temp_table(ID) SELECT d.ID FROM tb_order_orderdetail d INNER JOIN tb_order_payment p 
																ON p.ORDERID = d.ORDERID AND p.PRODID = d.PRODID 
																WHERE p.ORDERID = _orderid
																GROUP BY p.PRODID HAVING SUM(p.AMOUNT) < SUM(d.AMOUNT); -- 新增表数据
		UPDATE tb_order_orderdetail SET STATUS = '2' WHERE ID IN (SELECT id FROM temp_table); -- 更改订单详情状态（收全款）
		-- 删除表
		DROP TABLE temp_table;		
	END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `P_promocodeChange` */

/*!50003 DROP PROCEDURE IF EXISTS  `P_promocodeChange` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `P_promocodeChange`(in v_seq_name VARCHAR(50))
BEGIN
		DECLARE usecount INT DEFAULT 0;
		DECLARE pro VARCHAR(50);
		SELECT PROMOCODE INTO pro FROM tb_promocode_use WHERE PROMUSEID = F_currval(v_seq_name);
		UPDATE tb_promocode SET USED = 1,COUNT = COUNT+1 WHERE RPOMOCODE = pro;
		SELECT COUNT(*) INTO usecount FROM tb_promocode WHERE maxuse = count AND rpomocode = pro;
		IF usecount >= 1 THEN
			UPDATE tb_promocode SET `STATUS` = 0 WHERE promocode = pro;
		END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `P_update_customerdata` */

/*!50003 DROP PROCEDURE IF EXISTS  `P_update_customerdata` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `P_update_customerdata`()
BEGIN   
UPDATE tb_customer SET ASSIGNTYPE = '2' WHERE CUSTOMERID in (SELECT CUSTOMERID FROM v_redistributed );
UPDATE tb_customer_assign SET `STATUS` = '3' where CUSTOMERID IN (SELECT CUSTOMERID FROM v_redistributed );
END */$$
DELIMITER ;

